import React from 'react';
import ViewHeader from '../components/ViewHeader/index'
import globalMessages from '../messages';
import { FormattedMessage, IntlProvider } from 'react-intl';
import { DEFAULT_LOCALE } from '../i18n';
import surveyMessages from '../containers/Surveys/messages';


export default {
  title: 'View Header',
  component: ViewHeader
}

export function ViewHeaderContainer() {

  return (
    <div>
      <h3>View Header example</h3>
      <ViewHeader component="Test" body={<div>New Component</div>} />
    </div>
  )
}
